import{o as t,c as e,m as a,r as n,l as i,u as r}from"./vendor.1180558b.js";const s={class:"markdown-body"},d=[a('<h2>1 Overview</h2><p>        Linkis, as a powerful computing middleware, can easily interface with different computing engines. By shielding the usage details of different computing engines, it provides a The unified use interface greatly reduces the operation and maintenance cost of deploying and applying Linkis’s big data platform. At present, Linkis has docked several mainstream computing engines, which basically cover the data requirements in production, in order to provide more With good scalability, Linkis also provides related interfaces for accessing new engines, which can be used to access new computing engines.<br>         The engine is a component that provides users with data processing and analysis capabilities. Currently, it has been connected to Linkis’s engine, including mainstream big data computing engines Spark, Hive, Presto, etc. , There are also engines with the ability to process data in scripts such as python and Shell. DataSphereStudio is a one-stop data operation platform docked with Linkis. Users can conveniently use the engine supported by Linkis in DataSphereStudio to complete interactive data analysis tasks and workflow tasks.</p><table><thead><tr><th>Engine</th><th>Whether to support Scriptis</th><th>Whether to support workflow</th></tr></thead><tbody><tr><td>Spark</td><td>Support</td><td>Support</td></tr><tr><td>Hive</td><td>Support</td><td>Support</td></tr><tr><td>Presto</td><td>Support</td><td>Support</td></tr><tr><td>ElasticSearch</td><td>Support</td><td>Support</td></tr><tr><td>python</td><td>support</td><td>support</td></tr><tr><td>Shell</td><td>Support</td><td>Support</td></tr><tr><td>JDBC</td><td>Support</td><td>Support</td></tr><tr><td>MySQL</td><td>Support</td><td>Support</td></tr></tbody></table><h2>2. Document structure</h2><p>You can refer to the following documents for the related documents of the engines that have been accessed. -<a href="./../Engine_Usage_Documentations/Spark_User_Manual.md">Spark Engine Usage Document</a> -<a href="./../Engine_Usage_Documentations/Hive_User_Manual.md">Hive Engine Usage Document</a> -<a href="./../Engine_Usage_Documentations/Presto_User_Manual.md">Presto Engine Usage Document</a> -<a href="./../Engine_Usage_Documentations/ElasticSearch_User_Manual.md">ElasticSearch Engine Usage Document</a> -<a href="./../Engine_Usage_Documentations/Python_User_Manual.md">Python engine usage documentation</a> -<a href="./../Engine_Usage_Documentations/Shell_User_Manual.md">Shell Engine Usage Document</a> -<a href="./../Engine_Usage_Documentations/JDBC_User_Manual.md">JDBC Engine Usage Document</a> -<a href="./../Engine_Usage_Documentations/MLSQL_User_Manual.md">MLSQL Engine Usage Document</a></p>',5)],o={setup:(a,{expose:n})=>(n({frontmatter:{}}),(a,n)=>(t(),e("div",s,d)))},l={class:"markdown-body"},p=[a('<h2>1. 概述</h2><p>        Linkis作为一款功能强大的计算中间件，可以方便的对接不同的计算引擎，通过屏蔽不同计算引擎的使用细节，并向上提供了一套统一的使用接口，使得部署和应用Linkis的大数据平台的运维成本大大降低，目前，Linkis已经对接了几款主流的计算引擎，基本上涵盖了上生产上对数据的需求，为了提供更好的可拓展性，Linkis同时提供了接入新引擎的相关接口，可以利用该接口接入新的计算引擎。<br>         引擎是提供给用户数据处理和分析能力的组件，目前已经接入Linkis的引擎，有主流的大数据计算引擎Spark、Hive、Presto等，也有python、Shell这些脚本处理数据能力的引擎。DataSphereStudio作为对接了Linkis的一站式数据操作平台，用户可以方便的在DataSphereStudio中使用Linkis支持的引擎完成交互式数据分析任务和工作流任务。</p><table><thead><tr><th>引擎</th><th>是否支持Scriptis</th><th>是否支持工作流</th></tr></thead><tbody><tr><td>Spark</td><td>支持</td><td>支持</td></tr><tr><td>Hive</td><td>支持</td><td>支持</td></tr><tr><td>Presto</td><td>支持</td><td>支持</td></tr><tr><td>ElasticSearch</td><td>支持</td><td>支持</td></tr><tr><td>python</td><td>支持</td><td>支持</td></tr><tr><td>Shell</td><td>支持</td><td>支持</td></tr><tr><td>JDBC</td><td>支持</td><td>支持</td></tr><tr><td>MySQL</td><td>支持</td><td>支持</td></tr></tbody></table><h2>2. 文档结构</h2><p>已经接入的引擎相关文档可以参考如下文档。</p><ul><li><a href="./../Engine_Usage_Documentations/Spark_User_Manual.md">Spark 引擎使用文档</a></li><li><a href="./../Engine_Usage_Documentations/Hive_User_Manual.md">Hive 引擎使用文档</a></li><li><a href="./../Engine_Usage_Documentations/Presto_User_Manual.md">Presto 引擎使用文档</a></li><li><a href="./../Engine_Usage_Documentations/ElasticSearch_User_Manual.md">ElasticSearch 引擎使用文档</a></li><li><a href="./../Engine_Usage_Documentations/Python_User_Manual.md">Python 引擎使用文档</a></li><li><a href="./../Engine_Usage_Documentations/Shell_User_Manual.md">Shell 引擎使用文档</a></li><li><a href="./../Engine_Usage_Documentations/JDBC_User_Manual.md">JDBC 引擎使用文档</a></li><li><a href="./../Engine_Usage_Documentations/MLSQL_User_Manual.md">MLSQL 引擎使用文档</a></li></ul>',6)],u={setup:(a,{expose:n})=>(n({frontmatter:{}}),(a,n)=>(t(),e("div",l,p)))},h={setup(e){const a=n(localStorage.getItem("locale")||"en");return(e,n)=>"en"===a.value?(t(),i(r(o),{key:0})):(t(),i(r(u),{key:1}))}};export{h as default};
